import React from "react";
import "./Welcome.css";
import "bootstrap/dist/css/bootstrap.css";
const Welcome = () => {
  return (
    <div className="card__style">
      <br/>
      <br/>
      <br/>
        <h1 className="title__text">Find<br/>Love</h1>
      <div className="login__position">
      <div className="card__container">
            <h1>Create account or LogIn for Match !</h1>
            <div className="button_cont" align="center">
              <a className="example_f" href="add-website-here" target="_blank" rel="nofollow"><span />Add Call To Action</a>
            </div>
            <button>
              Sign In
            </button>
            <button>
              LogIn
            </button>
            </div>
      </div>
    </div>
  );
};

export default Welcome;
